import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getCardOverflowUtilityClass(slot) {
  return generateUtilityClass('JoyCardOverflow', slot);
}
const aspectRatioClasses = generateUtilityClasses('JoyCardOverflow', ['root', 'colorPrimary', 'colorNeutral', 'colorDanger', 'colorInfo', 'colorSuccess', 'colorWarning', 'variantPlain', 'variantOutlined', 'variantSoft', 'variantSolid']);
export default aspectRatioClasses;
